 &lt;/li&gt;\n          &lt;li&gt; Workers: 8 &lt;/li&gt;\n          &lt;li&gt; Threads: 192 &lt;/li&gt;\n          &lt;li&gt; Memory: 1.35 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport yaml\nfrom dask_interface import Initialization\nimport dask\nimport dask.array as da\nfrom dask.distributed import performance_report\nimport time\n\ndef Derivee(F, dx, periodic=0):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n              periodic = 1 if F is periodic\n       Output: dFdx = first derivative of F\n    \"\"\"\n    nx   = len(F)\n    #dFdx = 0. * F\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3:nx - 1] - F[1:nx - 3] - (F[4:nx] - F[0:nx - 4]) / 8.)\n    return dFdx\n\n# Get configuration\nwith open(r'config.yml') as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    Sworkers = data[\"workers\"]\n\n# Scheduler file name \nscheduler_info = 'scheduler.json'\n\n# Initialize the Deisa Adaptor \nAdaptor = Initialization(Sworkers, scheduler_info)\n\n# Check if client version is compatible with scheduler version\nAdaptor.client.get_versions(check=True)\n\n# Get data descriptor as a dict of Dask arrays\narrays = Adaptor.get_data()\n\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n   t = time.perf_counter()\n   # Get the Dask array global_t\n   gt = arrays[\"global_t\"]    \n   #gt = gt.rechunk({0: 1})\n   #print(gt.chunks)\n   # Construct a lazy task graph \n   der = Derivee(gt[::2], 1) \n   cpt =  da.linalg.norm(der, axis=(1,2))\n\n   # Submit the task graph to the scheduler\n   s = Adaptor.client.compute(cpt)\n   # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it.  \n   print(s.result(), flush=True)\n\nprint(\"Done in \", time.perf_counter() -t, \"secondes\")\nAdaptor.client.shutdown()\n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"dimensions":"width"},"id":"1236","type":"WheelZoomTool"},{"attributes":{"line_alpha":0.2,"line_color":"red","x":{"field":"time"},"y":{"field":"read_bytes"}},"id":"1310","type":"Line"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"num_minor_ticks":5,"tickers":[{"id":"1322"},{"id":"1323"},{"id":"1324"},{"id":"1325"},{"id":"1326"},{"id":"1327"},{"id":"1328"},{"id":"1329"},{"id":"1330"},{"id":"1331"},{"id":"1332"},{"id":"1333"}]},"id":"1293","type":"DatetimeTicker"},{"attributes":{},"id":"1290","type":"LinearScale"},{"attributes":{"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"memory"}},"id":"1275","type":"Line"},{"attributes":{"callback":null,"point_policy":"follow_mouse","tooltips":"\n            &lt;div&gt;\n                &lt;span style=\"font-size: 12px; font-weight: bold;\"&gt;@name:&lt;/span&gt;&amp;nbsp;\n                &lt;span style=\"font-size: 10px; font-family: Monaco, monospace;\"&gt;@duration_text&lt;/span&gt;\n            &lt;/div&gt;\n            "},"id":"1137","type":"HoverTool"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{"coordinates":null,"formatter":{"id":"1484"},"group":null,"major_label_policy":{"id":"1485"},"ticker":{"id":"1260"}},"id":"1259","type":"DatetimeAxis"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{"dimensions":"width"},"id":"1094","type":"WheelZoomTool"},{"attributes":{"callback":null,"point_policy":"follow_mouse","tooltips":"\n            &lt;div&gt;\n                &lt;span style=\"font-size: 14px; font-weight: bold;\"&gt;Name:&lt;/span&gt;&amp;nbs
